import styles from "../styles/Home.module.css";
import { useRouter } from "next/router";
import { motion } from "framer-motion";
import Link from "next/link";

export default function Project() {
  const {
    query: { project },
  } = useRouter();


  return (
    <div className={styles.container}>
      <motion.h1 layoutId="header">{project}</motion.h1>
      <Link href="/">

        <motion.div><iframe src={project === "midori" ? "https://www.loom.com/share/90888d767bcd49799320cf5e0ab04da9" : "https://www.loom.com/embed/38a9322267054843adb08ec95c7e5e87"} frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe></motion.div>

      </Link>
    </div>
  );
}
